import './Footer.css';
import logo from '../../../images/logos/wellfield.svg';

import { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';



function Footer() {
  const [config, setConfig] = useState({});


  return (
    <div className="footer__bg">
      <Container>
        <Row>
          <Col xs={12} lg={3} >
            <img src={logo} alt="Eco-Packers logo" />
          </Col>

          <Col xs={12} lg={3} >
            <Link to="/seamless" className="link footer__nav-item">Seamless</Link>
            <Link to="/moneyclip" className="link footer__nav-item">MoneyClip</Link>
            <Link to="/about" className="link footer__nav-item">About</Link>
          </Col>
        </Row>

      </Container >
    </div >
  );
}

export default Footer;
